import 'package:flutter/cupertino.dart';
import 'package:flutter/material.dart';
import 'package:flutter_staggered_grid_view/flutter_staggered_grid_view.dart';

class CustomGridView extends StatelessWidget {
  @override
  Widget build(BuildContext context) {
    return GridView.custom(
      scrollDirection: Axis.vertical,
      gridDelegate: SliverQuiltedGridDelegate(
        crossAxisCount: 4,
        mainAxisSpacing: 3,
        crossAxisSpacing: 1,
        repeatPattern: QuiltedGridRepeatPattern.inverted,
        pattern: [
          QuiltedGridTile(2,3 ),
          QuiltedGridTile(1, 1),
          QuiltedGridTile(1, 1),
          QuiltedGridTile(1, 2),
        ],
      ),
      childrenDelegate: SliverChildBuilderDelegate(
            (context, index) => Card(
            child: ClipRRect(
                borderRadius: BorderRadius.circular(5),
                child: Image.network(
                  images[index],
                  fit: BoxFit.cover,
                ))),
        childCount: images.length,
      ),
    );
  }

  List<String> images = [

    "https://st2.depositphotos.com/1001951/7898/i/600/depositphotos_78989850-stock-photo-hairstylist-washing-clients-hair-in.jpg",
    "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSd8A4B9NVlvGOs5Zf9WaWPiti8oElBfWLXFCx0wR1F5We1r4ovA2BC6FG7QIV_1tp6d64&usqp=CAU",
    "data:image/jpeg;base64,",
    "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQJAlPNr79XGNMPt_xvjh-GC4k4tFfwc6AABm_Wr79UZLFejgawYdBNYiryTlKAfzTHO64&usqp=CAU",
    "http://cdn.shopify.com/s/files/1/0408/8473/articles/header_10-barbearias_b99bc3d5-2ed1-435e-a2ee-bf091ba5c0ac_600x.jpg?v=1568418224",
  ];
}
